    return (
      <div>
          <div className="banner-gradient">
          <Container>
                <Jumbotron >
                    <div style={{"-webkit-transform": "skewY(-20deg)",
          transform: "skewY(-20deg)",
          backgroundColor:"black", height:'100px'}}></div>
                    <h1> Hello</h1>
                </Jumbotron >
         </Container>
          </div>
    </div>
    );
  }
}

export default LandingPage;
